			        <div className="overlay"></div>
			        <div className="container">
			          <div className="row description align-items-center justify-content-center">
			            <div className="col-md-8 text-center">
			              <div className="text">
			                <h2>Equip UI Kit</h2>
			                <h4 className="mb-5">A Free Bootstrap 4 UI Kit on Equip Design.</h4>
			                <p><a href="#" className="btn btn-primary px-5 py-4 mb-2"><i className="ion-ios-cloud-download mr-2"></i>Download Tools</a> <a href="#" className="btn btn-dark px-5 py-4 mb-2"><i className="ion-ios-code mr-2"></i>Components</a></p>

			              </div>
			            </div>
			          </div>
			        </div>
     			</section>

			</div>
		)

	}
}
export default Sec1;
